//import logo from './logo.svg';
import React, {Component} from 'react';
import './App.css';
import EmailIcon from '@material-ui/icons/Email';
import PhoneIcon from '@material-ui/icons/Phone';
import LocationOnIcon from '@material-ui/icons/LocationOn';
import CakeIcon from '@material-ui/icons/Cake';

class App extends Component {

  render (){
      return (
        <div>
          <h1 className='tc f1'>Joceline Yadira Martínez Vidal</h1>

            <div className="flex justify-center">
               <div className=" pa3">
                  <code><LocationOnIcon fontSize='large'/></code>
              </div>
              <div className=" pa1">
                  <code><p className='f4'> Mexico City</p></code>
              </div>
              <div className=" pa3">
                  <code><EmailIcon fontSize='large'/></code>
              </div>
              <div className='flex flex-column'>
                <div className=" pa1 mr1">
                    <code><p className='f4'> jocelineyadira@hotmail.com</p></code>
                </div>
                <div>
                    <code><p className='f4'> jocelineyadira@gmail.com</p></code>
                </div>
              </div>

              <div className=" pa3">
                  <code><PhoneIcon fontSize='large'/></code>
              </div>
              <div className=" pa1">
                  <code><p className='f4'> 5541782362</p></code>
              </div>
              <div className=" pa3">
                  <code><CakeIcon fontSize='large'/></code>
              </div>
              <div className=" pa1">
                  <code><p className='f4'> 14/10/1996</p></code>
              </div>
            </div> 

        </div>
      ); //fin return
  }//fin render
}//fin App

export default App;

